import React from 'react';
import Darray from 'Darray'

Datacircle=()=>{
    for(var i=0;i<length(Darray);i++)
    {
        <div className='col'>
        <h1 className='rounded-circle text-center border border-primary'>{Darray[i]}</h1>
        </div>
    }
}
export default Datacircle;
